import './styles/App.css';
import Nav from './components/Nav.js'
import About from './components/About.js'
import Projects from './components/Projects.js'
//import Beatmaker from './img/Beatmaker.png'


const backgroundImage ={
    dark : {
        background :'#000',
        color : '#FFF'
    },
    light : {
        background :'#FFF',
        color : '#000'
    }
}
const ThemeContext= React.createContext(backgroundImage.dark)

function App() {
  return (
    <div className="app">
        <ThemeContext.Provider>
            <Nav id="contact" backgroundImage={backgroundImage.dark}/>
            <Projects id="project" backgroundImage={backgroundImage.dark}/>
            <About id="about"/>
        </ThemeContext.Provider>

    </div>
  );
}

export default App;
